import React from "react";
import { Navbar, Nav, NavItem, NavLink, NavbarBrand } from "reactstrap";
import "../Styles/header.css";

export class NavBar extends React.Component {
  render() {
    return (
      <div>
        <Navbar className="navtheme" style={{ padding: 0 }}>
          <NavbarBrand>
            <img
              src={require("../Images/logo.png")}
              alt="logo"
              height="53px"
              width="200px"
            />
          </NavbarBrand>
          <Nav>
            <NavItem style={{ padding: 0 }}>
              <NavLink href="/" id="navItem">
                Find Companion
              </NavLink>
            </NavItem>
            <NavItem style={{ padding: 0 }}>
              <NavLink id="navItem" href="/">
                Friends
              </NavLink>
            </NavItem>
            <NavItem style={{ padding: 0 }}>
              <NavLink href="/" id="navItem">
                Explore Restaurants
              </NavLink>
            </NavItem>
          </Nav>
        </Navbar>
      </div>
    );
  }
}

export default NavBar;
